import React from 'react';
import './App.css';
import VideoFeed from './components/VideoFeed';

const App = () => {
    const cameraFeeds = [
        'http://ip-address-1/video-feed',
        'http://ip-address-2/video-feed',
        'http://ip-address-3/video-feed',
        // Aggiungi altri URL delle videocamere qui
    ];

    return (
        <div className="App">
            <h1>Camera Feeds</h1>
            <div className="video-feed-container">
                {cameraFeeds.map((feed, index) => (
                    <VideoFeed key={index} url={feed} />
                ))}
            </div>
        </div>
    );
};

export default App;
